import React from "react";
import "./TopTitle.css";
import { useTranslation } from "react-i18next";

export default function GuidePage() {
  const { t } = useTranslation();
  return (
    <div className="TopTitle">
      <h1 className="text-title">{t("nav.5")}</h1>
    </div>
  );
}
